type SelectedType = {
    items:ItemType[]
}

type ItemType = {
    title:string,
    value:any
}



export const Selected = (props:SelectedType)=>{
   return (
       <div>{props.items.map((i)=>{
           return(
               <select>{i.title}</select>
           )
       })}</div>
   )
}
